import { AST } from "eslint";
import React from "react";
import * as S from "./styled";
import { FaComment } from "react-icons/fa";
import profile from "../../assets/profile.jpg";
import { useEffect } from "react";
import api from "../../services/api";

export type CardProps = {
  profile_image?: string;
  nickName: string;
  text_post: string;
  title?: string;
  url_post: string;
  url_img_user?: string;
};

const CardPost: React.FC<CardProps> = ({
  nickName,
  profile_image,
  text_post,
  title,
  url_post,
  url_img_user,
}) => {
  console.log(url_img_user);

  useEffect(() => {
    api.get("/users").then((response) => console.log(response.data));
  }, []);

  return (
    <S.Wrapper to={url_post}>
      <S.ProfileImage>
        <img src={url_img_user} alt="" />
      </S.ProfileImage>
      <S.ContainerText>
        <h3>{nickName} </h3>
        <span> 15 dias atras </span>

        <S.PostTexTImportant>
          <p>{text_post}</p>
        </S.PostTexTImportant>

        <S.IconWrapper>
          <S.PostText>
            Comentarios <FaComment />
          </S.PostText>
        </S.IconWrapper>
      </S.ContainerText>
    </S.Wrapper>
  );
};

export default CardPost;
